import React, { useRef, useState } from "react";
import { Link } from "react-router-dom";
import { Button, Popover, OverlayTrigger, Overlay } from "react-bootstrap";
import "./Architecture.css";


export default function HowItWorks() {  


  const [show, setShow] = useState(false);
  const [target, setTarget] = useState(null);
  const ref = useRef(null);

  const handleClick = (event) => {
    setShow(!show);
    setTarget(event.target);
  };

  return (
    <body>
      <div ref={ref} className="imgContainer">
        <h5> Click on a number to learn more on the workflow. </h5>
        <img class="image" src={require("./architecture3.png")}
            alt="App architecture" 
            height="562"
            weight="644"
            usemap="#image-map">
        </img>
        <Button onClick={handleClick}>Holy guacamole!</Button>

        <Overlay
        show={show}
        target={target}
        placement="bottom"
        container={ref.current}
        containerPadding={20}
      >
        <Popover id="popover-contained">
          <Popover.Title as="h3">Popover bottom</Popover.Title>
          <Popover.Content>
            <strong>Holy guacamole!</strong> Check this info.
          </Popover.Content>
        </Popover>
      </Overlay>



      </div>
    </body>
  )

  }

